import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { withRouter } from 'next/router';
import Link from 'next/link';

class Header extends Component {
    render() {
        const navLinks = [
            {
                text: "ùñïùñîùñóùñôùñãùñîùñëùñéùñî",
                link: "/"
            },
            {
                text: "ùñíùñéùñòùñà",
                link: "/misc"
            },
            {
                text: "ùñëùñéùñãùñä",
                link: "/blog"
            },
            {
                text: "ùñÜùñáùñîùñöùñô",
                link: "/about"
            },
            {
                text: "ùñàùñîùñìùñôùñÜùñàùñô",
                link: "/contact"
            }
        ]
        return <div>
            <h1 className="text-center font-weight-bold mt-5">ùñóùñäùñëùñëùñéùñîùñò</h1>
            <Navbar expand="lg" className="navbar-light bg-transparent mt-5">
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse className="text-center" id="basic-navbar-nav">
                    <Nav className="justify-content-center" activekey={this.router.pathname}>
                        {navLinks.map(navItem => {
                            return <Nav.Link key={navItem.text}>
                                <Link href={navItem.link}>
                                    <a className="nav-link">{navItem.text}</a>
                                </Link>
                            </Nav.Link>
                        })}
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        </div >
    }
}

export default withRouter(Header);
